import React, { Component } from 'react';
import { canvasPult } from './canvasPult'
import './Pipline.css'

export class Pipline extends Component {
    static dislpayName = Pipline.name;

    render(){
        return (
            <section className="piplineSections">
                <div className="container">
                   <div className="row">
                        <div className="col-xxl-8 col-xl-8 col-lg-8">
                            <div className="canvasContainer">
                                <canvas id="piplineCanvas" width="500" height="300" >

                                </canvas>
                            </div>
                        </div>
                        <div className="col-xxl-4 col-xl-4 col-lg-4">
                            <div className="pultContainer">
                                <canvasPult/>
                            </div>
                        </div>
                   </div>
                </div>    
            </section>
           
        );
    }

}
